description:
Dadnapped (2009)  

Verenigde Staten
Actie/Familie

geregisseerd door Paul Hoen
met Emily Osment, Kirsten Storms en Jason Earles

Melissa's vader is een auteur die boeken schrijft over een tienerspion. Melissa concurreert met haar zussen, die allen zo hun eigen redenen hebben om te denken dat het personage gebaseerd is op een van hen. Wanneer de vader op een dag mysterieus verdwijnt, is het aan Melissa om hem op te sporen.

Ondertiteld door:
Luca, Dejavu en Gonnie
